first_digit_limit = int(input())
second_digit_limit = int(input())
third_digit_limit = int(input())
# logic
for first in range(1, first_digit_limit + 1):
    if first % 2 > 0: # We want only even numbers, get next number
        continue
    for second in range(2, second_digit_limit + 1):
        is_prime = False
        # Check for prime number
        for i in range(2, second):
            if second % i == 0:
                is_prime = True
        if is_prime:
            continue  # If not prime skip this iteration
        for third in range(1, third_digit_limit + 1): # We want only even numbers, get next number
            if third % 2 > 0:
                continue
            print(f'{first} {second} {third}')

