#include<stdio.h>
int main(){
	int n, i, j, fact, sum;
	printf("Enter the number: ");
	scanf("%d", &n);
	printf("Strong number between 1 to %d are: \n", n);
	for(i = 1; i <= n; i++){
		sum =0;
		j = i;
		while(j > 0){
			fact = 1;
			for(int k = 1; k <= j%10; k++)
			fact *= k;
			sum += fact;
			j /= 10;
		}
		if(sum == i)
			printf("%d\n", i);
	}
	return 0;
}

#include<stdio.h>
int main(){
	int num;
	printf("Enter the number: ");
	scanf("%d", &num);
	printf("The proper divisors of %d are : ", num);
	for(int i=2; i<num; i++){
		if(num%i == 0){
			printf("\n%d ", i);
		}
	}
	
	return 0;
}

#include<stdio.h>
#include<math.h>

int main(){
	int a, num, count=0, first_digit, last_digit;
	printf("Enter the number: ");
	scanf("%d", &num);
	a=num;
	while(a!=0){
		a /= 10;
		count++;
	}
	last_digit=num%10;
	first_digit=num/(int)pow(10, (count-1));
	
	num=num-(first_digit*(int)pow(10, count-1));
	num=(num-(last_digit))/10;
	
	if(count==2){
		printf("%d", last_digit);
		printf("%d", first_digit);
	}
	else{
		printf("%d", last_digit);
		printf("%d", num);
		printf("%d", first_digit);
	}
}
